import React, {useEffect} from 'react';
import '../assets/UserDashboard.css'; // Assuming you have this CSS file created
import logo from '../assets/logo_dark.png'; // Adjust the path accordingly

type UserDashboardProps = {
  userData: {
    username: string;
    email: string;
    memberSince: Date;
  };
};


const UserDashboard: React.FC<UserDashboardProps> = ({ userData }) => {
    useEffect(() => {
        document.body.classList.add('dashboard-page');

        return () => {
            document.body.classList.remove('dashboard-page');
        };
    }, []);

  return (
    <div className="wrapper">


      <nav className="vertical-nav">
        <ul>
          <li><a href="#">Profile</a></li>
          <li><a href="#">Settings</a></li>
          <li><a href="#">Logout</a></li>
        </ul>
      </nav>
    <div className='dashboard'>
      <header className="main-header">
            <div className="header-logo">
                <img src={logo} alt="Logo" />
            </div>
      </header>
      <main className="main-content">
        {/* Sample content for the main section */}
        <h2>Welcome, {userData.username}</h2>
        <h2>User Details</h2>
        <p><strong>Email:</strong> {userData.email}</p>
        <p><strong>Member Since:</strong> {userData.memberSince.toLocaleDateString()}</p>
      </main>
    </div>
   </div>
  );
}

export default UserDashboard;
